        function generateBarcode(value,elem){

            var btype = 'code128';
            var renderer = 'css';

            var quietZone = false;


            var settings = {
                output:renderer,
                bgColor: '#FFFFFF',
                color: '#000000',
                barWidth: '2',
                barHeight: '120',
                moduleSize: '0',
                posX: 0,
                posY: 0,
                addQuietZone: '0'
            };

            elem.html("").hide().barcode(value, btype, settings);

            return  elem.html();

        }
