        var iSAveChatdel = 0;
        var fWriteChat = function (text, color) {
            var date = new Date();
            var time = date.getHours() + ':' + date.getMinutes() + ':' + date.getSeconds();
            $('#chat').append('<div style="font-size:12px;color:' + (color != null ? color : 'black') + '"><font color="black">(' + date.getHours() + ':' + date.getMinutes() + ') ' + $('#cassirname').text() + ': </font>   ' + text + '</div>');

            var ggmes = '(' + date.getHours() + ':' + date.getMinutes() + ') ' + $('#cassirname').text() + ': ' + text;
            $.ajax({

                type: 'get', //тип запроса: get,post либо head
                url: 'srvloto.ashx',
                data: { 'oper': 'chatwrite', 'message': ggmes },

                dataType: 'text', //тип возвращаемого ответа text либо xml
                success: function (data, status, jqXHR) {//возвращаемый результат от сервера
                    try { if (data == "{\"st\":\"critical\"}") { fShowIdleMessage(-1); return; } } catch (exec) { }
                    try {
                    }
                    catch (exec) {
                        fWriteInfo(exec, '#CC0000');
                    }
                }
                ,
                error: function (data, status, jqXHR) {//возвращаемый результат от сервера
                    fShowIdleMessage(false);
                    fWriteInfo("Ошибка соединения, проверте подключение к интернету", 'red');
                }
            });
            date = null;
        }
        var fupdatechat = function () {
            $.ajax({

                type: 'get', //тип запроса: get,post либо head
                url: 'srvloto.ashx',
                data: { 'oper': 'chatget' },

                dataType: 'text', //тип возвращаемого ответа text либо xml
                success: function (data, status, jqXHR) {//возвращаемый результат от сервера
                    try { if (data == "{\"st\":\"critical\"}") { fShowIdleMessage(-1); return; } } catch (exec) { }
                    try {
                        $('#chat').children().remove();
                        var mes = data.split('_');
                        for (var _lt = iSAveChatdel; _lt < mes.length; _lt++)
                            $('#chat').append('<div style="font-size:12px;color:Black;">' + mes[_lt] + '</div>');
                    }
                    catch (exec) {
                        fWriteInfo(exec, '#CC0000');
                    }
                    setTimeout(function () { fupdatechat(); }, 8000);
                }
                ,
                error: function (data, status, jqXHR) {//возвращаемый результат от сервера
                    fShowIdleMessage(false);
                    fWriteInfo("Ошибка соединения, проверте подключение к интернету", 'red');
                    setTimeout(function () { fupdatechat(); }, 8000);
                }
            });
        };
