        var fGetRoundHist = function(srv,lst,r1,r2,dt1,dt2){
            $.ajax({

                type: 'get', //тип запроса: get,post либо head
                url: 'srvloto.ashx', //url адрес файла обработчика
                data: { 'oper':'grh','srv': srv, 'lst':lst, 'r1': r1,'r2':r2, 'dt1': dt1,'dt2':dt2}, //параметры запроса

                dataType: 'json', //тип возвращаемого ответа text либо xml
                success: function (data, status, jqXHR) {//возвращаемый результат от сервера
                    try{
                        $('#roundhistory').children().remove();
                        ighMax=data.max;
                        if(srv==6 || srv==7 || srv==10  || srv==9  || srv==8)
                        {
                            for( var i=0; i < data.max; i++)
                            {
                                fAddToroundhistList([(ighLST*25)+i+1, data.tir[i].data, data.tir[i].tir, (srv!=6?("&nbsp;&nbsp;"):"")+data.tir[i].ball]);
                            }
                            while ($('.histlist').length < 25) { fAddToroundhistList(["&nbsp;", "&nbsp;", "&nbsp;", "&nbsp;"]); }
                        }
                        else
                        {
                            for( var i=0; i < data.max; i++)
                            {
                                var inf = fGetKeyCard(data.tir[i].lc);
                                switch(inf[1])
                                {
                                    case "♠":inf[0]="Пики";inf[2]="Черный"; break;
                                    case "♣":inf[0]="Крести";inf[2]="Черный"; break;
                                    case "♦":inf[0]="Буби";inf[2]="Красный"; break;
                                    case "♥":inf[0]="Черви";inf[2]="Красный"; break;
                                }
                                switch(data.tir[i].comb)
                                {
                                    case 0: inf[1] = "Hight Card"; break;
                                    case 1: inf[1] = "One Pair"; break;
                                    case 2: inf[1] = "Two Pairs";  break;
                                    case 3: inf[1] = "Tree of a Kind";  break;
                                    case 4: inf[1] = "Street"; break;
                                    case 5: inf[1] = "Flash"; break;
                                    case 6: inf[1] = "Full House";  break;
                                    case 7: inf[1] = "Four of a Kind";  break;
                                    case 8: inf[1] = "Street Flash";  break;
                                    case 9: inf[1] = "Flash Royal"; break;
                                }
                                fAddToroundhistList([(ighLST*25)+i+1, data.tir[i].data, data.tir[i].tir, data.tir[i].pw,inf[0],inf[2],inf[1]]);
                            }
                            while ($('.histlist').length < 25) { fAddToroundhistList(["&nbsp;", "&nbsp;", "&nbsp;", "&nbsp;", "&nbsp;", "&nbsp;", "&nbsp;"]); }
                        }
                    }
                    catch(exc){}
                }
                ,
                error: function (data, status, jqXHR) {
                }
            });
        };
