        var frulBetCalcEM3= function () {

            for (var _ix = 0; _ix < iMaxbetEM3; _ix++) {
                iCredits[15] += parseInt(fUGIC($('.betEM3:eq(' + _ix + ')').children('#Summa').text()));
                $('.betEM3:eq(' + _ix + ')').children('#Summa').children().text("0,00");
            }
            iCredits[16] = iCredits[15];
            $('#moneybitchEM3').text(fGIC(iCredits[15]));
            var subxyi = parseInt(iCredits[15] / iMaxbetEM3);
            for (var _ix = 0; _ix < iMaxbetEM3; _ix++) {
                if (iCredits[15] - subxyi >= 0 && _ix != iMaxbetEM3 - 1) {
                    iCredits[15] -= subxyi;
                    $('.betEM3:eq(' + ((iMaxbetEM3 - 1) - _ix) + ')').children("#Summa").children().text(fGIC(subxyi));
                }
                else {
                    $('.betEM3:eq(' + ((iMaxbetEM3 - 1) - _ix) + ')').children("#Summa").children().text(fGIC(iCredits[15]));
                    iCredits[15] = 0;
                    break;
                }
            }
        };


